internal/counter/types.go: |
  package counter

  type Counter struct {
      value int
      name  string
  }

  func NewCounter(name string) *Counter {
      return &Counter{name: name, value: 0}
  }

  func (c *Counter) Increment() {
      c.value++
  }

  func (c *Counter) Value() int {
      return c.value
  }
